import React from 'react';
import { Menu } from 'antd';
import { GithubOutlined, LinkedinFilled } from '@ant-design/icons';

const AppHeader = () => {
  const socialLinks = {
    github: 'https://github.com/zehragizem',
    linkedin: 'https://www.linkedin.com/in/zehra-gizem-duman-344952237/',
  };

  const handleSocialClick = (link) => {
    window.open(link, '_blank'); // Yeni bir sekmede bağlantıyı aç
  };

  return (
    <div className='container-fluid'>
      <div className='header'>
        <div className='logo' />
        <Menu
          mode='horizontal'
          defaultSelectedKeys={['1']}
          style={{
            display: 'flex',
            justifyContent: 'flex-end',
            flex: 1,
            minWidth: 0,
          }}
        >
          <Menu.Item key='1'>Home</Menu.Item>
          <Menu.Item key='2'>About Me</Menu.Item>
          <Menu.Item key='3'>Skills</Menu.Item>
          <Menu.Item key='4'>Projects</Menu.Item>
          <Menu.Item key='5'>Blog</Menu.Item>
          <Menu.Item key='6'>Contact</Menu.Item>
        </Menu>
        <div style={{ display: 'flex' }}>
          <div
            className='icon-wrapper'
            onClick={() => handleSocialClick(socialLinks.github)}
          >
            <GithubOutlined style={{ fontSize: '18px', color: '#fff' }} />
          </div>
          <div
            className='icon-wrapper'
            onClick={() => handleSocialClick(socialLinks.linkedin)}
          >
            <LinkedinFilled style={{ fontSize: '18px', color: '#fff' }} />
          </div>
        </div>
      </div>
    </div>
  );
};

export default AppHeader;
